TITLE:
  - 'flow around a compressible ball, monolithic XFSI testcase which'
  - tests the ghost-penalty stabilization and timeintegration in case that an element is just touched
    at a single point/edge
  - 'at the beginning, as well as the restart of the monolithic Newton scheme and the ghost-penalty reconstruction
    for'
  - pseudo-time integration to predict velnp during the monolithic Newton
PROBLEM TYPE:
  PROBLEMTYPE: "Fluid_Structure_Interaction_XFEM"
STRUCTURAL DYNAMIC:
  RESTARTEVERY: 0
  M_DAMP: 0.5
  K_DAMP: 0.5
  TOLDISP: 1e-12
  TOLINCO: 1e-12
  PREDICT: "ConstDisVelAcc"
  LINEAR_SOLVER: 2
FSI DYNAMIC:
  COUPALGO: "iter_xfem_monolithic"
  MAXTIME: 20
  NUMSTEP: 2
  RESTARTEVERY: 3
  TIMESTEP: 0.01
FSI DYNAMIC/MONOLITHIC SOLVER:
  CONVTOL: 1e-12
  INFNORMSCALING: false
  ITEMAX: 4
  TOL_DIS_RES_L2: 1e-12
  TOL_DIS_RES_INF: 1e-12
  TOL_DIS_INC_L2: 1e-12
  TOL_DIS_INC_INF: 1e-12
  TOL_PRE_RES_L2: 1e-12
  TOL_PRE_RES_INF: 1e-12
  TOL_PRE_INC_L2: 1e-12
  TOL_PRE_INC_INF: 1e-12
  TOL_VEL_RES_L2: 1e-12
  TOL_VEL_RES_INF: 1e-12
  TOL_VEL_INC_L2: 1e-12
  TOL_VEL_INC_INF: 1e-12
FSI DYNAMIC/PARTITIONED SOLVER:
  CONVTOL: 1e-09
  ITEMAX: 20
  MAXOMEGA: 0.5
  PREDICTOR: "d(n)+dt*v(n)"
  RELAX: 0.825
FLUID DYNAMIC:
  LINEAR_SOLVER: 3
  NONLINITER: Newton
  LIFTDRAG: true
  RESTARTEVERY: 0
  NUMSTEP: 1000
  NUMSTASTEPS: 1
  MAXTIME: 20
  THETA: 1
FLUID DYNAMIC/NONLINEAR SOLVER TOLERANCES:
  TOL_VEL_RES: 1e-13
  TOL_VEL_INC: 1e-13
  TOL_PRES_RES: 1e-13
  TOL_PRES_INC: 1e-13
FLUID DYNAMIC/RESIDUAL-BASED STABILIZATION:
  GRAD_DIV: false
  DEFINITION_TAU: "Franca_Barrenechea_Valentin_Frey_Wall_wo_dt"
FLUID DYNAMIC/EDGE-BASED STABILIZATION:
  EOS_PRES: "xfem_gp"
  EOS_CONV_STREAM: "xfem_gp"
SOLVER 1:
  SOLVER: "UMFPACK"
  NAME: "XFSI_SOLVER"
SOLVER 2:
  SOLVER: "UMFPACK"
  NAME: "Structural_Solver"
SOLVER 3:
  SOLVER: "UMFPACK"
  NAME: "Fluid_Solver"
XFEM GENERAL:
  VOLUME_GAUSS_POINTS_BY: "DirectDivergence"
XFLUID DYNAMIC/STABILIZATION:
  NIT_STAB_FAC: 50
  CONV_STAB_SCALING: "abs_inflow"
  GHOST_PENALTY_STAB: true
  GHOST_PENALTY_FAC: 0.05
  GHOST_PENALTY_TRANSIENT_FAC: 0.005
  IS_PSEUDO_2D: true
MATERIALS:
  - MAT: 1
    MAT_fluid:
      DYNVISCOSITY: 1
      DENSITY: 1
      GAMMA: 1
  - MAT: 2
    MAT_Struct_StVenantKirchhoff:
      YOUNG: 50
      NUE: 0
      DENS: 1
FUNCT1:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "(1/0.3)*(1/0.3)*(0.6-y)*(y)"
  - COMPONENT: 1
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0"
  - COMPONENT: 2
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0"
  - COMPONENT: 3
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0"
FUNCT2:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "(1/0.3)*(1/0.3)*(0.6-y)*(y)"
  - COMPONENT: 1
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0"
  - COMPONENT: 2
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0"
  - COMPONENT: 3
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0"
FUNCT3:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "a"
  - VARIABLE: 0
    NAME: "a"
    TYPE: "multifunction"
    NUMPOINTS: 3
    TIMES: [0, 1, 5000]
    DESCRIPTION: ["0.5*(1.0+sin(pi/1.0*t-pi/2.0))", "0.5*(1.0+sin(pi/1.0*1-pi/2.0))"]
